(()=>{"use strict";Vue.component("search",{props:["name"],template:'\n    <button class="button-search" onclick="filterGoods()">{{name}}</button>\n    '}),Vue.component("basket",{props:["name"],template:'<div class="bascet">\n    <h3 class="bascet-name1">{{name}}</h3>\n    </div>'}),Vue.component("goods-item",{props:["goodProp"],methods:{async addToCart(){await fetch(`${API_URL}/addToCart`,{method:"POST",mode:"cors",headers:{"Content-Type":"application/json;charset=utf-8"},body:JSON.stringify(this.goodProp)})}},template:'\n      <div class="goods-item" @click=addToCart>\n        <h3>{{goodProp.product_name}}</h3>\n        <p>{{goodProp.price}}</p>\n      </div>\n    '}),Vue.component("goods-list",{props:["goods"],template:'\n      <div class="goods-list">\n        <goods-item v-for="goodEntity in goods" :goodProp="goodEntity"></goods-item>\n      </div>\n    '})})();